import './App.css';  // Make sure this is in App.js
import './index.css';  // Make sure this is in index.js


function App() {
 


  return (
<div className="App">
    <div class="Navigation">
   
      <button id="Add-Task">Add Task</button>
      <button id="Remove-Task">Remove Task</button>
      <button id="Edit-Task">Edit Task</button>
   
      </div>
  
  <div class="container">

    <div class="Task">
<button class="Check"></button>
<div class="Description">This is the description of the task</div>
    </div>

  </div>
</div>
  );
}

export default App;
